import{MDBBtn,MDBCard,MDBCardBody,MDBCardImage,MDBCardTitle,MDBCol,MDBCardText} from 'mdbreact';

function login(){
    return (
      <MDBCard color="stylish-color" style={{ width: "40rem" ,color:"white"}}>
        <MDBCardBody>
          <MDBCardTitle>Log In</MDBCardTitle>
          <MDBCardText>
            Some quick example text to build on the card title and make up the
            bulk of the card&apos;s content.
          </MDBCardText>
          <MDBBtn color="danger" href="#">
            MDBBtn
          </MDBBtn>
          <MDBBtn color="success" href="#">
            Login
          </MDBBtn>
        </MDBCardBody>
      </MDBCard>
    );
}

export default login;
